import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

// Importing the required CSS files
import 'feather-icons/dist/feather.css';
import 'themify-icons/css/themify-icons.css';
import 'datatables.net-bs4/css/dataTables.bootstrap4.css';
import '../public/vendors/css/vendor.bundle.base.css';
import '../public/js/select.dataTables.min.css';
import '../public/css/vertical-layout-light/style.css';

// Importing the required JS files
import 'feather-icons';
import 'chart.js';
import 'datatables.net';
import 'datatables.net-bs4';
import '../public/vendors/js/vendor.bundle.base.js';
import '../public/js/off-canvas.js';
import '../public/js/hoverable-collapse.js';
import '../public/js/template.js';
import '../public/js/settings.js';
import '../public/js/todolist.js';
import '../public/js/dashboard.js';
import '../public/js/Chart.roundedBarCharts.js';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
